// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";

contract NFTWalletBalanceChecker {

    address public owner;
    uint256 public expectedChainId = 51;

    mapping(string => IERC721Enumerable) public nftContracts; // Mapping NFT names to their contract addresses

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier correctChain() {
        require(block.chainid == expectedChainId, "Wrong network");
        _;
    }

    constructor() {
        owner = msg.sender;

        // Initialize NFT contracts (replace addresses accordingly)
        nftContracts["Character NFT"] = IERC721Enumerable(0x16fF83Dc4db1569fA6fEDCBc1F774370F7ba775f);
        nftContracts["AXE NFT"] = IERC721Enumerable(0x5aD2430fB36a57318C0e32fe267d54f5A5d10514);
        nftContracts["SAW NFT"] = IERC721Enumerable(0x5e84685C79fDcF391Fe12570577703944Ac983b4);
        nftContracts["Forge NFT"] = IERC721Enumerable(0x5C617BAD7e982D146F22f840c7790173Ce972bB8);
        nftContracts["Pickaxe NFT"] = IERC721Enumerable(0x1ad1438C4A3f790D9B4b279510700cEeBbD2A47d);
        nftContracts["Anvil NFT"] = IERC721Enumerable(0x1072850CB1ebc6B820795E5b022f4C7D9247D0fD);
        nftContracts["RowBoat NFT"] = IERC721Enumerable(0x1562162B92c49Dea3497d164529152f2fa43cBDE);
        nftContracts["Hammer NFT"] = IERC721Enumerable(0xb433AE8F7afd292C1688d58903532bE9A1f19A0c);
        nftContracts["Shovel NFT"] = IERC721Enumerable(0xe906B415D6E0f321bD5f9A53E306CED946AA0F61);
        nftContracts["Shears NFT"] = IERC721Enumerable(0x8E6CD2cc71d605b8Fb721a49d5E3eE47215435A4);
    }

    function setExpectedChainId(uint256 _chainId) external onlyOwner {
        expectedChainId = _chainId;
    }

    function checkNFTBalances(address user) external view correctChain returns (uint256[10] memory nftBalances) {
        // Check NFT balances
        nftBalances[0] = nftContracts["Character NFT"].balanceOf(user);
        nftBalances[1] = nftContracts["AXE NFT"].balanceOf(user);
        nftBalances[2] = nftContracts["SAW NFT"].balanceOf(user);
        nftBalances[3] = nftContracts["Forge NFT"].balanceOf(user);
        nftBalances[4] = nftContracts["Pickaxe NFT"].balanceOf(user);
        nftBalances[5] = nftContracts["Anvil NFT"].balanceOf(user);
        nftBalances[6] = nftContracts["RowBoat NFT"].balanceOf(user);
        nftBalances[7] = nftContracts["Hammer NFT"].balanceOf(user);
        nftBalances[8] = nftContracts["Shovel NFT"].balanceOf(user);
        nftBalances[9] = nftContracts["Shears NFT"].balanceOf(user);

        return nftBalances;
    }
}
